import React from "react";
import man from "../images/man.png";

const Main = () => {
  return (
    <div className="main">
      <h1 className="main-text" style={{ right: "100px" }}>
        Work Hard!
      </h1>
      <section className="hero">{/* <img src={man} alt="Logo" /> */}</section>
    </div>
  );
};

export default Main;
